  // fetchs the data needed for the table construction
  useEffect(()=>{
    fetch("https://w7liugfeo2.execute-api.eu-west-1.amazonaws.com/dev/drinks")
    .then(response => response.json())
    .then(data => setData(data))
 },[]);

